import React from 'react';
import { ThemeProvider } from '../ComponentThemeContext';
import ChatbotComponent from './Component/ChatbotComponent';
import './App.css';

function App() {
  return (
    <ThemeProvider>
      <div className="App">
        <header className="App-header">
          <h1>Chatbot Demo</h1>
        </header>
        <ChatbotComponent />
      </div>
    </ThemeProvider>
  );
}

export default App;
